import { useState } from 'react'

const LoginCustomer = () => {
	const [username, setUsername] = useState('')
    const [password, setPassword] = useState('')


	const onClickSave = async () =>
	{
		console.log(username)
		console.log(password)
		const res = await fetch(`http://localhost:8080/foodpanda/customers`,  
		{
			method: "POST",
		    headers: {
			"Content-type": "application/json"}, 
			body : JSON.stringify({username : username, password : password})
	    })
		.then(response=>{ return response.data; })
		.catch(error=>{ return error.response; })
       console.log(res)
		
	};
    return (
		<div className='container'>
		<h1>Welcome to DocApp!</h1>
		<form className="add-form">
			<div className="form-control">
				<label> Email </label>
				<input  type="text"
						placeholder="Enter email" value={username} onChange={(e) => setUsername(e.target.value)} />
			</div>
			<div className="form-control">
				<label> Password </label>
				<input type="password" placeholder="Enter password" value={password} onChange={(e) => setPassword(e.target.value)}/>
			</div>
			</form>
				<div>
				
		      	<button onClick={(e) => onClickSave(e)} class="btn btn-primary btn-block" type="submit">Save</button>
				
				</div>
      </div>
    )
};



export default LoginCustomer
